def my_func(input1):
    # Convert the input string to a list of integers
    numbers = list(map(int, input1.strip('[]').split()))

    # For each number, apply the formula (n - 6) // 3 and sum the results
    result = sum((n - 6) // 3 for n in numbers)

    return str(result)
